import React from 'react';

export const Posts = ({posts,loading}) => {

    if(loading){
        return <h2>Loading...</h2>
    }
    return (
       <ul className="">
           {posts.map(post =>(
               <li key={posts.id} className="">
                   {posts.title}
               </li>
           )
           )}
       </ul>
    )
}
